import React from "react";
import './banner.css'

function Banner() {
  return (
    <div className="custom-banner">
      <div
        className="m-auto d-flex align-items-center"
        style={{
          width: "400px",
          height: "50vh",
        }}
      >
        <div className="d-flex align-items-center" style={{ width: "100%" }}>

        </div>
      </div>
    </div>
  );
}

export default Banner;
